1.body:
When generating markup, the most common macro to be used is xhtml!. This macro takes mixed markup and rust code to output markup formatted as a String. Inside xhtml! there are several possible types of markup that can be sent to the formatter: XHTML Tags Unquoted Text Data Quoted Text Data To generate XHTML Tags, place the tags in angle brackets like normal markup. The tags can be self-closing or contain inner HTML. extern crate rdxl; fn main() { println!("{}",rdxl::xhtml!( <br/> ));
} To generate Unquoted Text Data it is usually sufficient to place the text directly in the markup. Note that macros are lexed as Rust code before being sent to the macro procedure. This means that not all XHTML can be placed directly inline. extern crate rdxl; fn main() { println!("{}",rdxl::xhtml!( <p>This paragraph is formatted normally. The breaking spaces are recognized as part of the macro rules.</p> ));
} For Text Data that does not work well with the Rust lexer, the text may be placed inside a rust quoted string literal. This string will be placed directly into the formatted output. It should be noted that raw strings are very a good way to fit even more text data into one quote without the need for escape characters. extern crate rdxl; fn main() { println!("{}",rdxl::xhtml!( r#"((((( the lexer expects closing braces, brackets, and parentheses [[[[ but what do we care. {{"# ));
}

3.body:
All html tags may be used directly in the body of the macro invocation. Most tag attributes may be used normally as well. Some tag attribute names, for example those with dashes in them, confuse the Rust lexer and therefore should be quoted. All strings are valid attribute names as long as they are quoted as a string literal. extern crate rdxl; fn main() { println!("{}", xhtml!( <a href="/this_is_ok" "this-must-be-quoted"="abcd">body of link</a> ));
} Rust expressions may be interpolated as attribute values. To insert a Rust expression in attribute position, use the double braces format. When rust expressions are used as attributes, the string value is quoted and escape characters are inserted in place of double quotes etc. extern crate rdxl; fn main() { let a_class = "my_class"; let a_style = "position:absolute; top:0; left:0;"; println!("{}", xhtml!( <div class={{a_class}} style={{a_style}}>inner html</div> ));
}
